          params.currentIter = 0;
          params.urlListIndex = params.urlListIndex + 1;
          setArg[exports.KEY_CURRENT_ITERATION] = params.currentIter;
          setArg[exports.KEY_URL_LIST_INDEX] = params.urlListIndex;
